here, ugh... I'm so caught up I haven't even had time to check our cache for resources.$b$bIf I were a mage, do you think I could use mirror images to do all of this at once?", "", "Return to Baros Alexston at your garrison in Shadowmoon Valley.", "", "", "", "", 824, 0, 0, 0, 55, 0, 0, 0, 890, 878, "Speak with Assistant Brightstone about her work ethic", "Gather Shelly's Report", 84455, 1, 112730, 1);
