n game in 'her land.'$B$BWe're not going to let her get away with saying that, right? Let's take down some clefthoof.", "", "Return to Kia Herman at Telaari Station.", "", "", "", "", 0, 0, 0, 0, 0, 0, 0, 0, 890, 878, "", 113100, 12);
