ward you must go through Gordawg.$b$bIt pains me, but Gordawg must be slain.$b$bSlay Gordawg and return the fury's heart to the Throne of Elements where it belongs.", "", "Bring the Heart of the Fury to Kalandrios.", "Death is the only way to free the great fury from Cho'gall's grasp.", "Gordawg", "", "", 0, 0, 0, 0, 0, 0, 0, 0, 890, 878, "", 113077, 1);
