ke weeds and if something isn't done, they'll spread across the entire continent!$b$bMake your way into Spiteleaf Thicket and slay as many podlings as you can find!", "", "Return to Mary Welsh.", "", "", "", "", 0, 0, 0, 0, 0, 0, 0, 0, 890, 878, "Spiteleaf podlings slain", 84832, 20);
