s. He thinks this will draw them back into the wilds of Gorgrond, giving us more room to maneuver around them.", "", "Return to Scout Valdez at your garrison in Shadowmoon Valley.", "", "", "", "", 823, 0, 0, 0, 800, 0, 0, 0, 890, 878, "Assault the botani forces in the Everbloom Wilds", 86624, 1);
